(defn r-plot [& commands]
  (let [rand-id (str (rand-int 1e6))
        rand-file (str "/tmp/rplot" rand-id ".svg")
        cairo-setup (str "Cairo(file=\"" rand-file "\", type=\"svg\", bg=\"white\", dpi=70, width=800)")]
    (r-try-parse-eval "library(\"Cairo\")")
    (r-try-parse-eval cairo-setup)
    (doseq [c commands]
      (r-try-parse-eval c))
    (r-try-parse-eval "dev.off()")
  (h/html-view (slurp rand-file))))

(r-plot "plot(iris)" "title(main = \"Iris\")")
    
  	
